    "12178305": {
        "title": "Unus mundus",
        "description": "Unus mundus (Latin for \"One world\") is an underlying concept of Western philosophy, theology, and alchemy, of a primordial unified reality from which everything derives. The term can be traced back to medieval Scholasticism though the notion itself dates back at least as far as Plato's allegory of the cave. The idea was popularized in the 20th century by the Swiss psychoanalyst Carl Gustav Jung, though the term can be traced back to scholastics such as Duns Scotus and was taken up again in the 16th century by Gerhard Dorn, a student of the famous alchemist Paracelsus. Dorn's explanation is illuminating in that it affords us a deep insight into the alchemical mysterium coniunctionis. If this is nothing less than a restoration of the original state of the cosmos and the divine unconsciousness of the world, we can understand the extraordinary fascination emanating from this mystery. It is the Western equivalent of the fundamental principle of classic Chinese philosophy, namely the union of yang and yin in tao, and at the same time a premonition of that \u201ctertium quid\u201d which, on the basis of psychological experience on the one hand and Rhine\u2019s experiments on the other, I have called \u201csynchronicity\u201d. If mandala symbolism is the psychological equivalent of the unus mundus, then synchronicity is its parapsychological equivalent.",
        "wikidata_id": "Q3116490",
        "url": "https://en.wikipedia.org?curid=12178305",
        "properties": {}
    },
